import React, { useEffect, useState } from "react";
import axios from "axios";
import Rankings from "../components/Rankings";
import "./styles/ResultsPage.css";

const ResultsPage = ({ onRestartGame, outputData, selectedCards }) => {
  return (
    <div className="results-page">
      <div className="results-header">
        <button className="results-header-button" onClick={onRestartGame}>
          Rankings
        </button>
        <button className="results-header-button" onClick={onRestartGame}>
          AI-titude
        </button>
      </div>
      <Rankings outputData={outputData} selectedCards={selectedCards} />
      <button onClick={onRestartGame}>Restart Game</button>
    </div>
  );
};

export default ResultsPage;
